using namespace std;
int minSteps(string s, string t) {      
		vector<int> vs(26,0);
		for (auto c : s) { vs[c - 'a']++; }
		
		int result = 0;
		for (int i = 0; i < t.size(); ++i) {
			vs[ t.at(i) - 'a']--;
			if (vs[t.at(i) - 'a'] < 0) {
				result++;
			}
		}
		
		return result;
	}

int main(int argc, char *argv[]) {
	string s(""
	);
	
	string t
	(
	""
	);
	cout << minSteps(s, t);
}


